    optical and physical data collected aboard the MELVILLE during cruise MV1102 in
    the South Atlantic Ocean and South Pacific Ocean from 2011-02-19 to 2011-03-14.
    These data include Attenuation/Transmission, CONDUCTIVITY, DEPTH - BOTTOM, DEPTH
    - OBSERVATION, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, SALINITY, WATER TEMPERATURE
